INSERT INTO `universites` (`id`, `title`, `heading`, `rank`, `intake`, `cost_of_living`, `tuition_fee`, `image`, `overview`, `area`) VALUES
(141, 'University of Bristol', 'South West England | UK | Public | Estd. 1595', '', 'Oct', 'GBP 1200', 'GBP 20500', '../university/1696071326.jpeg', '<p>The University of Bristol is a research-oriented university located in the city of Bristol, England. Established in the year 1595 as the Merchant Ventures School, makes the university to have its educational roots of more than 400 years old. Later through the years, the institution faced some academic changes&nbsp;like in the year 1833, it became the Bristol Medical School. Then in the year 1876, the institution became University College, Bristol. At that time, there were only 99 students enrolled in the institution.&nbsp;</p>\r\n\r\n<p>The institution received its royal university charter in the year 1909 and became the University of Bristol. At that time, there were only 288 undergraduate students. But after receiving the charter, 400 students enrolled in the same year.&nbsp; Throughout the years, the number of students, teaching faculty, academic and research facilities, as well as the reputation of the university gained immense growth.</p>\r\n\r\n<p><strong>Facts</strong></p>\r\n\r\n<ul>\r\n	<li><em>The University of Bristol has an educational history of more than 400 years.&nbsp;</em></li>\r\n	<li><em>The annual budget of the university for academics and researches was around &pound;682million in the year 2019-20.</em></li>\r\n	<li><em>The University of Bristol is also a member of the Russell Group of research-oriented British universities.</em></li>\r\n	<li><em>The university&#39;s 36 out of 46 departments had gained the top grade of 5 or 5* by the Research Assessment Exercise in the field of research-oriented studies.&nbsp;</em></li>\r\n	<li><em>The university also holds a Silver ranking in the Teaching Excellence Framework, highlighting its teaching quality.&nbsp;</em></li>\r\n</ul>\r\n', 'United Kingdom'),
(142, 'University of Glasgow', 'UK |  Estd. 1451', '', '', '', '', '../university/1696071481.jpg', '<p>The University of Glasgow, founded in 1451, stands as one of the oldest and most prestigious universities in the English-speaking world. Located in Glasgow, Scotland, this illustrious institution boasts a rich history of academic excellence and groundbreaking research. Over the centuries, the university has nurtured numerous notable scholars, innovators, and leaders who have left an indelible mark on various fields. With its gothic architecture and sprawling campus, the University of Glasgow is not only a hub of intellectual pursuit but also a testament to Scotland&#39;s longstanding commitment to higher education and its contributions to global academia.</p>\r\n', 'United Kingdom'),
(143, 'University of Manchester', 'Manchester | UK | Public | Estd. 1824', '6', 'Jan/Sep', 'GBP 1100', '', '../university/1696071582.jpg', '<p>The University of Manchester, commonly known as Manchester University, is a public-funded, research-oriented university situated in Manchester, England. The university was formed in the year 2004, by the merging of many prominent predecessor universities, like the University of Manchester Institute of Science and Technology and the Victoria University of Manchester.</p>\r\n\r\n<p>With more than 40,000 students enrolled, the university became the second-largest university in the UK in terms of the number of students. Also, the university has the fifth largest endowment of any university in the UK. Manchester University is also a member of the Russell Group of the British research universities.</p>\r\n\r\n<p><strong>Facts</strong></p>\r\n\r\n<ul>\r\n	<li><em>QS World University Rankings 2021 ranked the university #27 worldwide.</em></li>\r\n	<li><em>Times Higher Education (THE) World University Rankings 2021 gave the ranking of #51 to the Manchester University worldwide.</em></li>\r\n	<li><em>The university holds a Silver medal in the Teaching Excellence Framework.</em></li>\r\n	<li><em>The Alliance Manchester Business School of the university was ranked 3rd in the UK, 10th in Europe, and 30th in the world.</em></li>\r\n	<li><em>The university has Four Nobel Laureates currently as their academic staff, more than any other university in the UK.</em></li>\r\n</ul>\r\n', 'United Kingdom'),
(145, 'Queen Mary University of London', 'London | UK | Public | Estd. 1887', '16', 'Jan/May/Sep', 'GBP 3100', '', '../university/1696151358.png', '<p>It has been almost 30 years Queen Mary University of London is serving for Foundation and Pre-Masters programmes. The East London campus offers the pathway to more than 200 Bachelor&rsquo;s, as well as, Master&rsquo;s degree programmes. University academics have designed and brought these pathways in such a way that students find it quite an easy to continue with their degree level curriculum. The main objective of these foundation and pre masters programmes is to provide subject specific education and English language proficiency which help students to strengthen their base in pursuing further studies. If you are the one who wish to change his academic stream, or have not met the eligibility criteria for direct entry onto the University, then you must go for these pathways.<br />\r\n<br />\r\n<strong>Facts:</strong></p>\r\n\r\n<ul>\r\n	<li>Queen Mary University of London is one of the top universities in UK</li>\r\n	<li>The east London campus has students from over 162 nationalities across the world.</li>\r\n	<li>QUML is also a part of the University of London and Rusell group.</li>\r\n	<li>92% of the grads from QUML are either into jobs or pursue further studies within the first 6 months of the degree completion.</li>\r\n	<li>The International foundation year, which offers entry into over 100 bachelors courses at Queen Mary is widely recognized among institutions in the UK and across boundaries.</li>\r\n</ul>\r\n', 'United Kingdom'),
(146, 'University College London', 'London | UK | Public | Estd. 1826', '3', '', '', '', '../university/1696151462.png', '<p>University College London, which operates as UCL, is a major public research university in London, United Kingdom. UCL is a member institution of the federal University of London and is the second-largest university in the United Kingdom by total enrolment and the largest by postgraduate enrolment.</p>\r\n\r\n<p>Established in 1826, as London University, by founders inspired by the radical ideas of Jeremy Bentham, UCL was the first university institution to be established in London and the first in England to be entirely secular and to admit students regardless of their religion. UCL also makes contested claims to be the third-oldest university in England and the first to admit women. In 1836, UCL became one of the two founding colleges of the University of London, which was granted a royal charter in the same year.</p>\r\n\r\n<p><strong>Facts -&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li><em>UniSA boasts remarkable statistics and a solid international reputation for such a young organisation.</em></li>\r\n	<li><em>Several of the most prestigious rating organisations in the world have included it in their lists.</em></li>\r\n	<li><em>According to the 2015 QS World University Rankings, the university is in the top 3% of more than 10,000 institutions worldwide.</em></li>\r\n	<li><em>I</em><em>t draws students from all over the world, not only from Australia.</em></li>\r\n	<li><em>With 36,000 students, 6,000 of them are foreign students, mostly from Asia, UniSA has a thriving international community.</em></li>\r\n</ul>\r\n', 'United Kingdom'),
(147, 'University of Nottingham', 'UK', '9', '', '', '', '../university/1696151608.jpeg', '<p>The University of Nottingham, established in 1881, is a world-renowned institution that prides itself on a legacy of academic excellence, cutting-edge research, and a rich tapestry of cultural diversity. Nestled in the heart of England, its picturesque campuses are a blend of historic architecture and modern facilities, offering students and faculty a dynamic environment to inspire innovation and discovery. Recognised consistently for its commitment to sustainability and its global outreach through international campuses in China and Malaysia, the University of Nottingham is more than just a place of learning; it&#39;s a community where global thinkers are nurtured and where ideas take flight.</p>\r\n', 'United Kingdom'),
(148, 'University of Liverpool', 'North West | UK | Public | Estd. 1881', '17', 'Jan/Sep', 'GBP 3300', '', '../university/1696151698.jpeg', '<p><strong>History:</strong></p>\r\n\r\n<p>The University of Liverpool was started as a college called the university college of Liverpool in 1881. It became an independent university with its current name the University of Liverpool in 1903 due to the royal charter and act of parliament. It also granted the university to issue its own degrees as compared to the earlier external degrees from the University of London.<br />\r\n<br />\r\n<strong>Facts:</strong></p>\r\n\r\n<ul>\r\n	<li>The University was among the founding members of Russell as well as the N8 groups too.</li>\r\n	<li>Kaplan Open Learning part of Kaplan, Inc, is a partner for the University&#39;s online programmes.</li>\r\n	<li>The University&#39;s alumni include 10 Nobel prize winners.</li>\r\n	<li>The university campus is spread across 100 acres with mainly three main faculty areas namely Humanities and Social Sciences, Health and Life Sciences, and Science and Engineering.</li>\r\n</ul>\r\n', 'United Kingdom'),
(149, 'Cardiff University', 'Cardiff | UK | Public | Estd. 1883', '18', '', '', '', '../university/1696152252.jpg', '<p><strong>Cardiff University</strong>&nbsp;(Welsh:&nbsp;<em>Prifysgol Caerdydd</em>) is a public research university in Cardiff, Wales. It was established in 1883 as the&nbsp;<strong>University College of South Wales and Monmouthshire</strong>&nbsp;and became a founding college of the University of Wales in 1893. It merged with the&nbsp;<strong>University of Wales Institute of Science and Technology</strong>&nbsp;(UWIST) in 1988 as the&nbsp;<strong>University of Wales College, Cardiff</strong>&nbsp;(<strong>University of Wales, Cardiff</strong>, from 1996). In 1997 it received degree-awarding powers, but held them in abeyance. It adopted the operating name of Cardiff University in 1999; this became its legal name in 2005, when it became an independent university awarding its own degrees.</p>\r\n\r\n<p>Cardiff University is the only Welsh member of the Russell Group of research-intensive British universities. Academics and alumni of the university have included three heads of state or government, two Nobel Prize winners, 15 fellows of the Royal Society, 11 fellows of the Royal Academy of Engineering, seven fellows of the British Academy, 21 fellows of the Academy of Medical Sciences and 34 fellows of the Academy of Social Sciences.</p>\r\n', 'United Kingdom'),
(150, 'The University of Edinburgh', 'Edinburgh, Scotland | UK | Public | Estd. 1583', '5', '', '', '', '../university/1696152372.jpg', '<p>The&nbsp;<strong>University of Edinburgh</strong>&nbsp;(Scots:&nbsp;<em>University o Edinburgh</em>, Scottish Gaelic:&nbsp;<em>Oilthigh Dh&ugrave;n &Egrave;ideann</em>; abbreviated as&nbsp;<em><strong>Edin.</strong></em>&nbsp;in post-nominals) is a public research university in Edinburgh, Scotland. Granted a royal charter by King James VI in 1582 and officially opened in 1583, it is one of Scotland&#39;s four ancient universities and the sixth-oldest university in continuous operation in the English-speaking world. The university played an important role in Edinburgh becoming a chief intellectual centre during the Scottish Enlightenment and contributed to the city being nicknamed the &quot;Athens of the North&quot;.</p>\r\n\r\n<p>The university is a member of several associations of research-intensive universities, including the Coimbra Group, League of European Research Universities, Russell Group, Una Europa, and Universitas 21. In the fiscal year ending 31 July 2021, it had a total income of &pound;1,175.6&nbsp;million, of which &pound;324.0&nbsp;million was from research grants and contracts, with the third-largest endowment in the UK, behind only Cambridge and Oxford. The university has five main campuses in the city of Edinburgh, which include many buildings of historical and architectural significance such as those in the Old Town.</p>\r\n', 'United Kingdom'),
(151, 'The University of Sheffield', 'Sheffield | UK | Public | Estd. 1905', '12', 'Feb/Sep', '', 'GBP 20500', '../university/1696152511.jpg', '<p>University of Sheffield is a public research university established in 1905 in Sheffield, South Yorkshire, England. The University of Sheffield traces back to the foundation of Sheffield Medical School in the year 1828, Firth College in the year 1879 and Sheffield Technical School in the year 1884. The university has 25,000 students, 3,900 international students from 120 different countries, and approximately 6,000 staff. Sheffield tops among the best 10 UK universities for research grant funding. According to new data issued by the Higher Education Statistics Agency, this university has become 1st in the UK for income and investment in engineering research.<br />\r\n<br />\r\n<strong>Facts -&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>The University of Sheffield holds a position in the top 7 British universities by postgraduate student enrollment, along with UCL, King&#39;s, Birmingham, Manchester etc.</li>\r\n	<li>The University of Sheffield is ranked among the six red-brick universities founded and constructed in the industrial area of England.</li>\r\n	<li>The University of Sheffield was ranked 45 out of 500 universities in Europe.</li>\r\n	<li>99 per cent of Sheffield&#39;s research was graded as internationally recognized and world-leading&nbsp;</li>\r\n</ul>\r\n', 'United Kingdom'),
(152, 'Durham University', 'Durham | UK | Public | Estd. 1832', '33', 'Jan/Sep', 'GBP 148', '', '../university/1696152644.jpg', '<p>Durham University was founded in 1832 by an Act of Parliament. The university received the Royal Charter in 1837. This is the third-oldest university in England. The university is a member of the Russel Group of British research universities after becoming a member of the 1994 group. During its expansion phase, the university became the first English University to establish connections overseas.&nbsp;</p>\r\n\r\n<p>The university is comprised of 17 colleges.</p>\r\n\r\n<p>In 2005, the university presented a re-brand logotype and introduced the name Durham University. The official name of the university is the University of Durham.</p>\r\n\r\n<p>Facts:</p>\r\n\r\n<ul>\r\n	<li>The motto of the college is &quot;Her foundations are upon the holy hills&quot;.</li>\r\n	<li>The colour of the university is Palatinate.&nbsp;</li>\r\n	<li>The university also runs a newspaper called Palatinate.&nbsp;</li>\r\n	<li>Among British Universities, it had the sixth-highest average UCAS Tariff for new entrants in 2018</li>\r\n	<li>Durham Castle is still used as University College making it one of the oldest buildings in use.&nbsp;&nbsp;</li>\r\n</ul>\r\n', 'United Kingdom'),
(153, 'University of Leeds', 'Yorkshire and the Humber | UK | Public | Estd. 1904', '8', 'Jan/Sep', 'GBP 3300', '', '../university/1696152769.jpeg', '<p>The University of Leeds was established in 1874 as Yorkshire College of Science and later it merged with Leeds School of Medicine in 1884. Altogether, this merger of universities was named as Yorkshire College. Then finally the university got its royal charter in 1904. Since 2006 the university has been ranked in the top 4 in the UK. The motto of the university is &lsquo;And knowledge will be increased.</p>\r\n\r\n<p><strong>Programs:</strong></p>\r\n\r\n<p>International students can choose from over 200 undergraduate courses at University of Leeds. The university offers more than 300 master&rsquo;s programs.&nbsp;University of Leeds also offers various foundation, apprenticeship, and intercalated degrees to its student. Some of the top programs at University of Leeds are as follows:</p>\r\n\r\n<ul>\r\n	<li>Master of Engineering [M.Eng], Automotive Engineering&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Master of Science [M.Sc], Accounting and Finance&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Master of Science [M.Sc], Advanced Computer Science&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Master of Science [M.Sc], Chemistry&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Master of Science [M.Sc], Data Science and Analytics&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Master of Science [M.Sc], Mechatronics and Robotics&nbsp;&nbsp; &nbsp;</li>\r\n	<li>Master of Science [M.Sc], Digital Information Management and Systems Innovation</li>\r\n</ul>\r\n\r\n<p><strong>Facts:</strong></p>\r\n\r\n<ul>\r\n	<li>The university has 36,250 students enrolled in total.</li>\r\n	<li>Out of 169 universities, it is the 5th largest university in UK.</li>\r\n	<li>From 170 countries every year, 9,000 international students take admission.</li>\r\n	<li>The university has Gold rating in the Teaching Excellence Framework.</li>\r\n	<li>Ranked 18th in Best Global Universities by U.S News and World Report.</li>\r\n</ul>\r\n', 'United Kingdom'),
(154, 'University of Warwick', 'Coventry, England | UK | Public | Estd. 1965', '10', '', '', '', '../university/1696152899.jpg', '<p>The&nbsp;<strong>University of Warwick</strong>is a public research university on the outskirts of Coventry between the West Midlands and Warwickshire, England. The university was founded in 1965 as part of a government initiative to expand higher education. The Warwick Business School was established in 1967, the Warwick Law School in 1968, Warwick Manufacturing Group (WMG) in 1980, and Warwick Medical School in 2000. Warwick incorporated Coventry College of Education in 1979 and Horticulture Research International in 2004.</p>\r\n\r\n<p>Warwick is primarily based on a 290 hectares (720 acres) campus on the outskirts of Coventry, with a satellite campus in Wellesbourne and a central London base at the Shard. It is organised into three faculties&mdash;Arts, Science Engineering and Medicine, and Social Sciences&mdash;within which there are 32 departments. As of 2019, Warwick has around 26,531 full-time students and 2,492 academic and research staff. It had a consolidated income of &pound;703.7&nbsp;million in 2020/21, of which &pound;139.8&nbsp;million was from research grants and contracts. Warwick Arts Centre is a multi-venue arts complex in the university&#39;s main campus and is the largest venue of its kind in the UK, which is not in London.</p>\r\n', 'United Kingdom'),
(155, 'University of Southampton', 'UK', '23', '', '', '', '../university/1696153019.jpg', '<p>The University of Southampton, founded in 1862, stands as a beacon of research excellence and academic prowess in the southern coast of England. Globally recognized for its pioneering contributions in various disciplines, the university has consistently maintained its place amongst the top institutions in the UK and around the world. With its state-of-the-art facilities and a sprawling campus that&#39;s a blend of contemporary design and natural beauty, the University of Southampton provides an enriching environment for its diverse student body and esteemed faculty. Fostering innovation, critical thinking, and a global perspective, the university continues to shape the minds of its students, preparing them to make significant contributions to the global community.</p>\r\n', 'United Kingdom'),
(156, 'King&#39;s College London', 'London | UK | Public | Estd. 1829', '7', 'Jan/Sep', 'GBP 800', '', '../university/1696153122.jpg', '<p>King&#39;s College London is a public-funded, research-oriented university in London, England. Established in 1829 as the King&#39;s College, the University has a sapretty old and prestigious educational background. With junior&nbsp;and senior departments, the institution started round 100 students. After the King&#39;s College London Act 1 of 882, the institution&#39;s name changed to King&#39;s College London.&nbsp;</p>\r\n\r\n<p>With time further in the 20th Century, the institution merged with other institutions. Later in the year 2006, the institution received itswn university charter, and it ought to award a degree in affiliation to the University of London.</p>\r\n\r\n<p><strong>Facts</strong></p>\r\n\r\n<ul>\r\n	<li><em>They were founded in 1892 by King George 4 and Arthur Wellesley, the 1st Duke of Wellington.</em></li>\r\n	<li><em>It has been claimed to be the 4th oldest University.</em></li>\r\n	<li><em>The University is divided into 9 subdivisions of faculties and departments.</em></li>\r\n	<li><em>The University has 5 campuses where students can get the whole experience of studying abroad.</em></li>\r\n	<li><em>It has contributed to many types of research,s DNA Structure and Hepatitis C discovery.</em></li>\r\n</ul>\r\n', 'United Kingdom'),
(157, 'Newcastle University', 'UK', '14', 'Jan/Apr/Sep', '', '', '../university/1696153299.jpg', '<p>Newcastle University, founded in 1834 as part of the historic University of Durham, is a prestigious institution located in the heart of Newcastle upon Tyne, England. Esteemed for its research-driven approach, the university consistently ranks among the top academic establishments in the UK and globally. With its rich history juxtaposed against modern advancements, the campus offers a unique blend of architectural beauty and state-of-the-art facilities. Renowned for its rigorous academic programs, commitment to societal impact, and vibrant student community, Newcastle University remains a dynamic hub of learning and innovation, continuously pushing the boundaries of knowledge and contributing profoundly to both regional and global academia.</p>\r\n', 'United Kingdom'),
(158, 'University of Exeter', 'Exeter | UK | Public | Estd. 1955', '15', 'Jan/May/Sep', 'GBP 3500', '', '../university/1696153401.jpg', '<p>The University of Exeter is located in Exeter, Devon, England and was given the university status in the year 1955. It is a public university that was first known as the St. Luke&rsquo;s College in the year 1838 which later formed the Exeter School of Art in 1855 and then in 1863, Exeter School of Science was formed. Finally in the year 1955, it received the royal charter and the University of Exeter came into force. The University of Exeter has four campuses spread across Exeter and Cornwall. The Streatham and St. Luke&rsquo;s campuses are in Exeter while the Truro and Penryn campuses are in Cornwall.<br />\r\n<br />\r\n<strong>Facts:</strong><br />\r\n1. According to the Times Higher Education World University Rankings, The University of Exeter is ranked among the top 175 universities worldwide.<br />\r\n2. According to the QS World University Rankings, the University of Exeter is ranked 164th.<br />\r\n3. The University of Exeter has some of the most reputed alumni like J.K. Rowling, Sultan bin Muhammad Al-Qasimi, Zara Tindall and more.<br />\r\n4. The university has around 4,100 students and over 280 international students from all around the world making it one of the most diverse universities in the UK.<br />\r\n5. The University of Exeter expertise in areas of different fields including Sport and Health Sciences, Biosciences, Geography, Psychology, etc.</p>\r\n', 'United Kingdom'),
(165, 'Arizona State University', 'Arizona | USA | Public | Estd. 1964', '40', 'Jan-Oct', '', 'AUD 32800', '../university/1696510925.jpg', '<p>Arizona State University&#39;s (ASU) past is full with colour, life, and boldness. Public research universities include ASU. It began as the Territorial Normal School in 1885. The institution was renamed several times until becoming Arizona State University in 1958. Arizona University&#39;s more than 100-year history has contributed to the university&#39;s seven-year streak of U.S. News &amp; World Report designation as the most creative institution in the nation.</p>\r\n\r\n<p>A well-known university in the study abroad field is Arizona State University. It comes in at number 216 in the QS World University Rankings. According to U.S. News and World Report&#39;s rankings for 2022, Arizona State University is ranked 165th. ASU is also acknowledged in the QS World Rankings 2022.</p>\r\n', 'USA'),
(166, 'George Washington University', 'Washington | USA | Private | Estd. 1821', '69', '', '', '', '../university/1696511000.jpeg', '<p><strong>The George Washington University</strong>&nbsp;(<strong>GW</strong>&nbsp;or&nbsp;<strong>GWU</strong>) is a private federally chartered research university in Washington, D.C. Chartered in 1821 by the United States Congress, GWU is the largest institution of higher education in the District of Columbia.</p>\r\n\r\n<p>George Washington, the first President of the United States, advocated for the establishment of a national university in the U.S. capital in his first State of the Union address in 1790 and continued to promote this idea throughout his career and until his death. In his will, Washington left shares in the Potomac Company to endow the university. However, due to the company&#39;s financial difficulties, funds were raised independently. On February 9, 1821, the university was established by an Act of Congress first as&nbsp;<strong>Columbian College</strong>&nbsp;and then as&nbsp;<strong>Columbian University</strong>, making it one of only five universities in the United States with a Congressional charter.</p>\r\n', 'USA'),
(167, 'Virginia Tech Language and Culture Institute, Blacksburg, Virginia (Only UG Pathways)', 'Virginia | USA', '', '', '', '', '../university/1696511126.jpg', '', 'USA'),
(168, 'INTO George Mason University', 'Virginia | USA | Public | Estd. 1979', '94', 'Jan/May/Aug', 'USD 11705', '', '../university/1696511244.jpg', '<p>George Mason University, commonly known as the Mason or George Mason and shortened as GMU, is a public-funded research-oriented university located in the Fairfax County, Virginia, USA. The university was established in the year 1949 as a branch of University of Virginia in the Northern Virginia region. It was named after one of the Founding Father of USA, George Mason.&nbsp;&nbsp;</p>\r\n\r\n<p>Later in the year 1972, after the Virginia General Assemble Bill H210, the educational institution got separated from the University of Virginia and became an independent university, George Mason University.&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Programs:</strong></p>\r\n\r\n<ul>\r\n	<li>Psychology</li>\r\n	<li>Criminal justice</li>\r\n	<li>Accounting</li>\r\n	<li>Liberal arts and sciences, general studies and humanities</li>\r\n	<li>Economics</li>\r\n	<li>Visual and performing arts</li>\r\n	<li>Liberal arts and sciences/liberal studies</li>\r\n	<li>English language and literature</li>\r\n	<li>Neuroscience</li>\r\n	<li>Cinematography and film/video production</li>\r\n	<li>Drama and dramatics/theatre arts</li>\r\n	<li>Public administration</li>\r\n	<li>Business/commerce</li>\r\n	<li>Computer science</li>\r\n	<li>Physics</li>\r\n	<li>Sociology</li>\r\n	<li>Philosophy</li>\r\n	<li>Athletic training/trainer</li>\r\n	<li>Astronomy</li>\r\n</ul>\r\n\r\n<p><strong>Facts:</strong></p>\r\n\r\n<ul>\r\n	<li>Washington Monthly, magazine of US Politics and Government, ranked the Mason University at the position of #61 nationally.&nbsp;</li>\r\n	<li>The university holds several faculties who won Nobel Memorial Prize in Economics, Pulitzer Prize winner, and Fullbright Scholars.&nbsp;</li>\r\n	<li>George Mason University is the largest university in the commonwealth of Virginia.&nbsp;</li>\r\n</ul>\r\n', 'USA'),
(169, 'Duke University', 'North Carolina | USA | Private | Estd. 1838', '17', 'Sep/Feb', 'USD 14230', '', '../university/1696511369.jpg', '<p><strong>Duke University</strong>&nbsp;is a private research university in Durham, North Carolina. Founded by Methodists and Quakers in the present-day town of Trinity in 1838, the school moved to Durham in 1892. In 1924, tobacco and electric power industrialist James Buchanan Duke established The Duke Endowment and the institution changed its name to honor his deceased father, Washington Duke.</p>\r\n\r\n<p>The campus spans over 8,600 acres (3,500 hectares) on three contiguous sub-campuses in Durham, and a marine lab in Beaufort. The West Campus&mdash;designed largely by architect Julian Abele, an African American architect who graduated first in his class at the University of Pennsylvania School of Design&mdash;incorporates Gothic architecture with the 210-foot (64-meter) Duke Chapel at the campus&#39; center and highest point of elevation, is adjacent to the Medical Center. East Campus, 1.5 miles (2.4 kilometers) away, home to all first-years, contains Georgian-style architecture. The university administers two concurrent schools in Asia, Duke-NUS Medical School in Singapore (established in 2005) and Duke Kunshan University in Kunshan, China (established in 2013).</p>\r\n', 'USA'),
(170, 'Oregon State University', 'Oregon | USA | Public | Estd. 1868', '61', 'Jan/Mar/Jun...', 'USD 6400', '', '../university/1696511467.jpg', '<p><strong>History</strong></p>\r\n\r\n<p>Established in 1868,<em>&nbsp;</em><strong><em>Oregon State University&nbsp;</em></strong>is a public university situated in Corvallis Oregon, USA.&nbsp; The objective of the courses that they offer is to build a smarter, healthier and prosperous world. The colour of the university&rsquo;s logo is Beaver Orange, Paddle tail Black and Bucktooth White. &nbsp;</p>\r\n\r\n<p>The university was originally named as Corvallis Academy and the name was changed 11 times till it got its final name. The school was granted to give bachelors and masters degree in the year of 1870.</p>\r\n\r\n<p><strong>Facts</strong></p>\r\n\r\n<ol>\r\n	<li><strong><em>Ranked second in&nbsp;</em></strong><strong><em>Forest program in the world by CWUR</em></strong></li>\r\n	<li><strong><em>Has two campuses and 11 colleges in total</em></strong></li>\r\n	<li><strong><em>Student enrolment averages near 32,000</em></strong></li>\r\n	<li><strong><em>More than 200 degree programs to choose from</em></strong></li>\r\n	<li><strong><em>Ranked 68</em></strong><strong>&nbsp;</strong><strong><em>in Top Public Universities by US News</em></strong></li>\r\n</ol>\r\n', 'USA'),
(171, 'Saint Leo University', 'Florida | USA | Private | Estd. 1889', '906', 'Jan/Aug', 'USD 4900', '', '../university/1696511652.jpeg', '<p><strong>Saint Leo University</strong>&nbsp;is a private Roman Catholic liberal arts university in St. Leo, Florida. It was established in 1889. The university is associated with the Holy Name Monastery, a Benedictine convent, and Saint Leo Abbey, a Benedictine monastery. The university and the abbey are both named for Pope Leo the Great, bishop of Rome from 440 to 461. The name also honors Leo XIII, who was Pope at the time, and Leo Haid, then abbot of Maryhelp Abbey in North Carolina, now Belmont Abbey, who participated in founding the university and served as its first president.</p>\r\n\r\n<p>The first Roman Catholic college in Florida, Saint Leo is one of the five largest Catholic colleges in the United States. It enrolls students at the traditional University Campus, at more than 40 education centers and offices, and through its Center for Online Learning. University-wide, Saint Leo educates students from all 50 states, the District of Columbia, three U.S. territories, and more than 80 countries. As of Spring 2017, total enrollment was 16,207 students, with 2,088 of those at University Campus.</p>\r\n\r\n<p>Saint Leo was one of the first American universities to provide distance learning opportunities to students, beginning with educating military men and women in 1973 during the Vietnam era at the height of the anti-war movement. Saint Leo University offers more than 40 associate, baccalaureate, and master&#39;s degrees, and certificate programs and inaugurated its first doctoral program in 2013. As of Fall 2016, the faculty included 219 full-time faculty and 1,157 fully qualified adjunct faculty members.</p>\r\n\r\n<p><strong>Facts</strong></p>\r\n\r\n<ol>\r\n	<li>Saint Leo University ranked #4 amid the regional universities ranking for international students.</li>\r\n	<li>Saint Leo University holds the rank of #4 in the category of ethnic diversity</li>\r\n</ol>\r\n', 'USA'),
(172, 'Purdue University Northwest', 'USA | Public | Estd. 1946', '', '', '', '', '../university/1696511799.jpeg', '<p>Purdue University Northwest was established in 2016. Two Purdue campuses&mdash;in Hammond, Indiana and Westville, Indiana&mdash;unified to help eliminate administrative duplication, and provide academic excellence to strengthen student education and opportunities.</p>\r\n\r\n<ul>\r\n	<li>The unification of Purdue Calumet (Hammond) and Purdue North Central (Westville) was approved by the Higher Learning Commission on March 4, 2016.</li>\r\n	<li>This officially marked the establishment of Purdue University Northwest. However, Purdue Calumet and Purdue North Central each have an important history. With World War II taking place, these two campuses offered technical courses as part of the national defense training program with the federal government.</li>\r\n	<li>The campuses remained open when the war ended in 1945, offering credited courses. Both campuses were built as a credited university in 1946.</li>\r\n</ul>\r\n', 'USA'),
(173, 'Ashland University', 'USA | Public | Estd. 1946', '389', 'Jan/May/Sep', '', '', '../university/1696511911.jpeg', '<p>Purdue University Northwest was established in 2016. Two Purdue campuses&mdash;in Hammond, Indiana and Westville, Indiana&mdash;unified to help eliminate administrative duplication, and provide academic excellence to strengthen student education and opportunities.</p>\r\n\r\n<ul>\r\n	<li>The unification of Purdue Calumet (Hammond) and Purdue North Central (Westville) was approved by the Higher Learning Commission on March 4, 2016.</li>\r\n	<li>This officially marked the establishment of Purdue University Northwest. However, Purdue Calumet and Purdue North Central each have an important history. With World War II taking place, these two campuses offered technical courses as part of the national defense training program with the federal government.</li>\r\n	<li>The campuses remained open when the war ended in 1945, offering credited courses. Both campuses were built as a credited university in 1946.</li>\r\n</ul>\r\n', 'USA');
